import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import AuthForm from './pages/AuthForm';

function App() {
  return (
    <>
    <BrowserRouter>
      <Routes>
        <Route path='/cityjail' element={<AuthForm />}/>
      </Routes>
    </BrowserRouter>


    <div className="App">
      hello world
    </div>
    </>
  );
}

export default App;
